import { Link } from "react-router-dom"

function Statistics(props) {
    const data = props.data
    console.log(data)
    const handleError = (event) => {
        event.target.src = "https://i.ibb.co/q9SWXK2/player-placeholder.png";
    };

    return (
        <div className="flex">
        {data?.map((stat, index) => {
            <div key={index} className="flex py-4 rounded-lg bg-white brd flex-col">
                <div className="text-base font-medium px-4">{stat.header}</div>
                <div className="brd"></div>
                {stat?.topThree?.map((pl, index2) => {
                    <Link to={"/player/" + (pl?.id)}>
                        <div key={index2} className="flex justify-between items-center">
                            <div className="flex items-center gap-3">
                                <div className="overflow-hidden h-8 w-8 rounded-full">
                                    <img className="h-full" alt="playerPhoto" onError={handleError} src={`https://images.fotmob.com/image_resources/playerimages/${pl?.id}.png`} />
                                </div>
                            </div>
                        </div>
                    </Link>
                })}
            </div>
        })}
        </div>
    )
}

export default Statistics
